import React from 'react';

function EventList({ events, selectedEvents, toggleSelectedEvent }) {
    return (
        <div className="event-list">
            <h2>All Events</h2>
            <ul>
                {events.map(event => (
                    <li key={event.id}>
                        <div>{event.event_name}</div>
                        <div>{event.event_category}</div>
                        <div>{event.start_time} - {event.end_time}</div>
                        <button onClick={() => toggleSelectedEvent(event.id)}>
                            {selectedEvents.includes(event.id) ? 'Deselect' : 'Select'}
                        </button>
                    </li>
                ))}
            </ul>
        </div>
    );
}

export default EventList;
